import React from 'react'

import Button from './ButtonMisc'
import ButtonSubmit from './ButtonSubmit'

const ButtonSelection = () => {
    return (
        <div style={{display: "inlineBlock"}}>
            <ButtonSubmit />
            <Button name="Cancel" />
        </div>
    )
}

export default ButtonSelection
